import React from 'react';

const Login = () => {
    return (
        <div className="main-wrap">
            <div className="login-main">
                <h1>Heythere</h1>
                <input type="email" placeholder="email" className="box1 border1"/>
                <input type="password" placeholder="password" className="box1 border2"/>
                <input type="submit" className="send" value="Go"/>
                <a href="index.html">go</a>
                <div className="message"></div>
                <p>Not a Member? <a href="/register">click here</a></p>
                <p>Forgot Your Password? <a href="#">click here</a></p>
            </div>

            <style jsx>{`
*{
    margin: 0;
    padding: 0;
    border: 0;
    text-decoration: none;
  outline:none;
}
body,a{
    font-family: calibri;
    font-size: 14px;
    font-weight: normal;
    color: #3B424D;

}
.main-wrap{
    background: #FF5335;
    width: 100%;
    height: 100%;
    position: absolute;
}
.login-main{
    width: 300px;
    height: 158px;
    position: absolute;
    margin: auto;
    top: 0;
    bottom: 0;
    left: 0;
    right: 0;
    background:#fcb1ac;
    padding: 10px;
    border-radius: 10px;
}

.login-main p {
    text-indent:10px;
}

.box1{
    background: lighten(#FF5335, 30%);
    height: 40px;
    text-indent: 10px;
    width: 90%;
    margin-bottom: 2px;
    color: #FF5335;
    font-size: 15px;
    font-weight: 400;
}
.border1{
    border-radius: 5px 5px 0 0;
}
.border2{
    border-radius: 0px 0 5px 5px;
}

.send{

    width:  60px;
    height: 60px;
    border-radius: 50%;
    position: absolute;
    right: 9px;
    top: 20px;
    border: 5px solid lighten(#FF5335, 10%);
    background: #FF5335;
    font-size: 18px;
    color: #fff;
    font-weight: normal;
    text-shadow: 1px 1px 2px #000;
    box-sizing: border-box;
    -webkit-box-sizing: border-box;

}

.send:hover {
    animation: spin 0.3s ease-in-out;
    -webkit-animation: spin 0.3s ease-in-out;
    -moz-animation: spin 0.3s ease-in-out;
    -ms-animation: spin 0.3s ease-in-out;
    -o-animation: spin 0.3s ease-in-out;
    cursor: pointer;
}


@keyframes spin{
    from{
        transform: rotate(0deg);
    }
    to{
        transform: rotate(360deg);
    }
}
@-webkit-keyframes spin{
    from{
        -webkit-transform: rotate(0deg);
    }
    to{
        -webkit-transform: rotate(360deg);
    }
}
@-moz-keyframes spin{
    from{
        -moz-transform: rotate(0deg);
    }
    to{
        -moz-transform: rotate(360deg);
    }
}
@-o-keyframes spin{
    from{
        -o-transform: rotate(0deg);
    }
    to{
        -o-transform: rotate(360deg);
    }
}


            `}</style>
        </div>
    );
};

export default Login;
